// Imports
import React, { Component } from 'react';
import './textfield.css';

import EOSLogo from '../img/eos.png';

class Textfield extends Component {
  render() {
    return (
      <div class="search">
        <img src={EOSLogo}/>
        <input placeholder="Search term"/>
      </div>
    );
  }
}

export default Textfield;
